import React , {Component} from 'react'
import { Link } from 'react-router-dom'
import { Button } from 'react-bootstrap'
import { connect } from 'react-redux';
import {withRouter} from "react-router-dom"

import "./review.css"

class Review extends Component {

    constructor(props){
      super(props)
      //this.percentageCalc = this.percentageCalc.bind(this);
    }

    percentageCalc(){
      let myPercent = "0%";
      (this.props.chance.chance == "unacc") ? myPercent =  "25%" : null;
      (this.props.chance.chance == "acc") ?  myPercent = "50%" : null;
      (this.props.chance.chance == "good") ?  myPercent = "75%" : null;
      (this.props.chance.chance == "vgood") ?  myPercent = "95%" : null;
      return myPercent;
    }

    render(){
        let myPercentage = this.percentageCalc();
        return (
          <div className="row">
            <div className="col-md-8 col-md-offset-2">
              <h1>Your Best Fit Candidate</h1>
              <br />
              <br />
              <br />
              <row>
                <div className="col-md-4 col-md-offset-1">
                <img src="data:image/jpeg;base64," id="john_picture"/></div>
                <div className="col-md-4 col-md-offset-">
                  <h4>Name : John Filson</h4>
                  <h4>EnterpriseID : john.filson </h4>
                  <h4>Description : Developer</h4>
                  <h4>Level : 3</h4>
                  <h4>Percentage Fit : {myPercentage} </h4>
                  <button type="button" className="btn btn-primary">Contact</button>
                </div>
              </row>
            </div>
          </div>
        )
    }
};

const mapStateToProps = (state, ownProps) => {
  return {
    chance: state.chance
  }
}

function mapDispatchToProps(dispatch){
  return {
      submitDetails: (roleTitle, roleLevel, industryExpetise, technologyExpetise, gallup, certifications, education, years) => dispatch(commonActions.submitDetails(roleTitle, roleLevel, industryExpetise, technologyExpetise, gallup, certifications, education, years))
  };
}

export default  connect(mapStateToProps, mapDispatchToProps)(withRouter(Review));
